//
// funkcija decimala skaitla a
//
function roundTo(num, pow)
{
	try
		{
		num *= Math.pow(10, pow);
		num = (Math.round(num) / Math.pow(10, pow)) + "";
		if (num.indexOf(".") == -1) num += ".";
		while (num.length - num.indexOf(".") - 1 < pow) num += "0";
		return num;
		}
	catch(err)
		{
		if (errTxt == "") {errTxt = "Error [" + err.message + "]";}
		throw "err_kluda"
		}
}

{
	try

}

//
// funkcija skaitla formata parbaudei 
//
function isCorrect(in_value, in_format)
{
	try
		{
		// decimala atdal&#299;taja komata aizsta&#353;ana ar punktu
		in_value = in_value.replace(/,/g, ".");

		// parbaude vai norad&#299;ts obligatais lauks
		if (in_value == "")
			{errTxt = "Specify the required field values ​​for the calculation!";
			throw "err_parametri"}

		// parbaude vai ievad&#299;tie dati ir skaitlis
		if (isNaN(in_value))
			{errTxt = "Field value '" + in_value + "' does not match '" + in_format + "'";
			throw "err_parametri"}
		else
			// parbaude vai sakr&#299;t punkta poz&#299;cija
			if (in_value.indexOf(".") != in_format.indexOf("."))
				{errTxt = "Lauka v&#275;rt&#299;ba '" + in_value + "' neatbilst form&#257;tam '" + in_format + "'";

			else

}

		var EM4 = -AT4 * (BD4 / 6.0) * (BR4 + 2 * BM4);
		var ER4 = AT4 * (BF4 / 120.0) * (-4 * BT4 * (1 - 6 * BM4) + BS4 * (9 - 68 * BM4) + 72 * BR4 * BM4 + 24 * BO4);
		var EW4 = -AT4 * (BH4 / 5040.0) * (61 + 662 * BM4 + 1320 * BO4 + 720 * BQ4);
		var FB4 = EC4 + EH4 + EM4 + ER4 + EW4;
		var FA4 = (FB4 / Math.PI) * 180;
		var EX4	= Math.floor(FA4);
		var EY4	= Math.abs(Math.floor((FA4 - EX4) * 60));
		var EZ4 = Math.abs((FA4 - EX4 - (EY4 / 60.0)) * 3600);

		// rezultata v&#275;rt&#299;bu pie&#353;&#311;ir&#353;ana
		out_nBDeg = CU4;
		out_nBMin = CV4;
		out_dBSec = roundTo(CW4, 5);

		out_nLDeg = EX4;
		out_nLMin = EY4;
		out_dLSec = roundTo(EZ4, 5);
		}
	catch(err)
		{
		if (errTxt == "") {errTxt = "Error [" + err.message + "]";}
		throw "err_kluda"
		}
}



//
// funkcija B,L > X,Y(LKS)
//
function BL_XY()
{
try
		{
		// konstantes
		var A0 = 0.998324298452795;
		var A2 = 0.0025146070605187;
		var A4 = 0.00000263904659433762;
		var A6 = 0.00000000341804608659579;

		// apr&#275;&#311;ins
		var dBDeg = in_nBDeg + in_nBMin / 60.0 + in_dBSec / 3600.0;
		var dBRad = dBDeg * Math.PI / 180.0;
		var m = a * (A0 * dBRad - A2 * Math.sin(2 * dBRad) + A4 * Math.sin(4 * dBRad) - A6 * Math.sin(6 * dBRad));
		var Rho = a * (1 - e2) / Math.pow((1 - e2 * Math.pow(Math.sin(dBRad), 2)), 1.5);
		var Nu = a / Math.pow((1 - e2 * Math.pow(Math.sin(dBRad), 2)), 0.5);
		var Psi  = Nu / Rho;
		var t = Math.tan(dBRad);
		var dLDeg = in_nLDeg + in_nLMin / 60.0 + in_dLSec / 3600.0;

		var DiffLong = dLDeg - nLongCMerid;
		var DiffRad = DiffLong * Math.PI / 180.0;
		var NTerm1 = Math.pow(DiffRad, 2) / 2 * Nu * Math.sin(dBRad) * Math.cos(dBRad);
		var NTerm2 = Math.pow(DiffRad, 4) / 24 * Nu * Math.sin(dBRad) * Math.pow(Math.cos(dBRad), 3) * (4 * Math.pow(Psi, 2) + Psi - Math.pow(t, 2));
		var NTerm3 = Math.pow(DiffRad, 6) / 720 * Nu * Math.sin(dBRad) * Math.pow(Math.cos(dBRad), 5) * (8 * Math.pow(Psi, 4) * (11 - 24 * Math.pow(t, 2)) - 28 * Math.pow(Psi, 3) * (1 - 6 * Math.pow(t, 2)) + Math.pow(Psi, 2) * (1 - 32 * Math.pow(t, 2)) - Psi * 2 * Math.pow(t, 2) + Math.pow(t, 4));
		var NTerm4 = Math.pow(DiffRad, 8) / 40320 * Nu * Math.sin(dBRad) * Math.pow(Math.cos(dBRad), 7) * (1385 - 3111 * Math.pow(t, 2) + 543 * Math.pow(t, 4) - Math.pow(t, 6));
		
		// apr&#275;&#311;inam LKS x
		var X = K0 * (m + NTerm1 + NTerm2 + NTerm3 + NTerm4) +FalseNm;

		var ETerm1 = Math.pow(DiffRad, 2) / 6 * Math.pow(Math.cos(dBRad), 2) * (Psi - Math.pow(t, 2));
		var ETerm2 = Math.pow(DiffRad, 4) / 120 * Math.pow(Math.cos(dBRad), 4) * (4 * Math.pow(Psi, 3) * (1 - 6 * Math.pow(t, 2)) + Math.pow(Psi, 2) * (1 + 8 * Math.pow(t, 2)) - Psi * 2 * Math.pow(t, 2) + Math.pow(t, 4));
		var ETerm3 = Math.pow(DiffRad, 6) / 5040 * Math.pow(Math.cos(dBRad), 6) * (61 - 479 * Math.pow(t, 2) + 179 * Math.pow(t, 4) - Math.pow(t, 6));

		// apr&#275;&#311;inam LKS y
		var Y = K0 * Nu * DiffRad * Math.cos(dBRad) * (1 + ETerm1 + ETerm2 + ETerm3) + FalseEm;

		// rezultata v&#275;rt&#299;bu pie&#353;&#311;ir&#353;ana
		out_X = roundTo(X, 3);
		out_Y = roundTo(Y, 3);
		}
	catch(err)
		{
		if (errTxt == "") {errTxt = "Error [" + err.message + "]";}
		throw "err_kluda"
		}
}



//
// funkcija X,Y,Z > B,L,h
//
function XYZ_BLh()
{
try
		{
		// apr&#275;&#311;ins
		var p = Math.sqrt(in_X * in_X + in_Y * in_Y);
		var r = Math.sqrt(p * p + in_Z * in_Z);
		var mju = Math.atan((in_Z / p) * ((1 - f) + (e2 * a) / r));

		var lon = Math.atan(in_Y / in_X);
		var N = (lon < 0) ? Math.PI + lon : lon;
		var dd  = (N / Math.PI) * 180;

		var ltl = in_Z * (1 - f) + e2 * a * Math.pow(Math.sin(mju), 3);
		var lbl = (1 - f) * (p - e2 * a * Math.pow(Math.cos(mju), 3));
		var lat = Math.atan(ltl / lbl);

		var ldd = (lat / Math.PI) * 180;

		// rezultata v&#275;rt&#299;bu pie&#353;&#311;ir&#353;ana
		out_nBDeg = Math.floor(ldd);
		out_nBMin = Math.floor((ldd - out_nBDeg) * 60);
		out_dBSec = roundTo((ldd - out_nBDeg - (out_nBMin / 60)) * 3600, 5);

		out_nLDeg = Math.floor(dd);
		out_nLMin = Math.floor((dd - out_nLDeg) * 60);
		out_dLSec = roundTo((dd - out_nLDeg - (out_nLMin / 60)) * 3600, 5);

		out_h = roundTo(p * Math.cos(lat) + in_Z * Math.sin(lat) - a * Math.sqrt(1 - e2 * Math.sin(lat) * Math.sin(lat)), 3);
		}
	catch(err)
		{
		if (errTxt == "") {errTxt = "Error [" + err.message + "]";}
		throw "err_kluda"
		}
}



//
// funkcija B,L,h > X,Y,Z
//
function BLh_XYZ()
{
try
		{
		// apr&#275;&#311;ins
		var dBDeg = in_nBDeg + in_nBMin / 60.0 + in_dBSec / 3600.0;
		var dLDeg = in_nLDeg + in_nLMin / 60.0 + in_dLSec / 3600.0;
		var dBRad = dBDeg * Math.PI / 180.0;
		var dLRad = dLDeg * Math.PI / 180.0;

		var v = a / Math.sqrt(1 - e2 * Math.pow(Math.sin(dBRad), 2));
		var V = (1 - e2) * v;

		// rezultata v&#275;rt&#299;bu pie&#353;&#311;ir&#353;ana
		out_X = roundTo((v + in_h) * Math.cos(dBRad) * Math.cos(dLRad), 3);
		out_Y = roundTo((v + in_h) * Math.cos(dBRad) * Math.sin(dLRad), 3);
		out_Z = roundTo((V + in_h) * Math.sin(dBRad), 3);
		}
	catch(err)
		{
		if (errTxt == "") {errTxt = "Error [" + err.message + "]";}
		throw "err_kluda"
		}
}

//
// funkcija B,L,h > H
//
function BLh_H()
{
try
		{	
		// apr&#275;&#311;ins
		var dBDeg = in_nBDeg + in_nBMin / 60.0 + in_dBSec / 3600.0;
		var dLDeg = in_nLDeg + in_nLMin / 60.0 + in_dLSec / 3600.0;

		var iMax = Math.floor((m_dBmax - m_dBmin) / m_dStepB) + 1.0001;
		var jMax = Math.floor((m_dLmax - m_dLmin) / m_dStepL) + 1.0001;


		var i0 = Math.floor((dBDeg - m_dBmin) / m_dStepB + 0.0001);
		var j0 = Math.floor((dLDeg - m_dLmin) / m_dStepL + 0.0001);
		var i1 = Math.floor((dBDeg - m_dBmin) / m_dStepB + 1.0001);
		var j1 = Math.floor((dLDeg - m_dLmin) / m_dStepL + 1.0001);

		var fi0 = m_dStepB * i0 + m_dBmin;
		var la0 = m_dStepL * j0 + m_dLmin;

		var a1 = m_Grid[Math.abs(Math.floor((iMax - 1 - i0) * jMax + j0))];		
		var a2 = m_Grid[Math.abs(Math.floor((iMax - 1 - i1) * jMax + j0))];
		var a3 = m_Grid[Math.abs(Math.floor((iMax - 1 - i0) * jMax + j1))];
		var a4 = m_Grid[Math.abs(Math.floor((iMax - 1 - i1) * jMax + j1))];

	    var rn = (dBDeg - fi0) / m_dStepB;
